import React from "react";
import Book from "./book";

function Library(props) {
  return (
    <div>
      <Book name="처음만난 파이썬" numOfPage={300} />
      <Book name="처음만난 AWS" numOfPage={400} />
      <Book name="처음만난 REACT" numOfPage={500} />
    </div>
  );
}
export default Library;
